import {Row, Col, CardImg} from 'reactstrap';
import Logo from "../assets/images/Logo_ML.png";

class Header extends Component{

    constructor(props) {
		super(props);
		this.toggle = this.toggle.bind(this);
		this.state = {
            isOpen:true,
		  dropdownOpen: false
		};
	}

	toggle() {
		this.setState({
		  dropdownOpen: !this.state.dropdownOpen,
		});
	}

	render(){
        const pos = {barr:{size: 10, offset: 1}, logo:"1", barSerch:"11"}
		return(
			<Row>
                <Col xs={pos.barr} sm={pos.barr} md={pos.barr}>
                    <Row>
                        <Col xs={pos.logo} sm={pos.logo} md={pos.logo} className="logo" >
                            <a href='/'>Donde comprar y vender<CardImg src={Logo}/></a>
                        </Col>
                        <Col xs={pos.barSerch} sm={pos.barSerch} md={pos.barSerch} className="bg-primary">d</Col>
                    </Row>
                </Col>
            </Row>
		)
	}
}

export default Header;
